import React from 'react';

function Navbar() {
    return (
        <nav class="navbar navbar-light bg-light">
            <ul>
                <li>Loop Fruits</li>
                <li></li>
            </ul>
            <span class="navbar-brand mb-0 h1">Loop Fruits</span>
        </nav>
    );
};

export default Navbar;
